Okay, let's think through this ultimatum game scenario and design a computational model for responder behavior.

**Key Psychological Mechanisms:**

1.  **Fairness/Inequity Aversion:** People generally dislike unequal distributions, particularly when they are disadvantaged. This can lead to rejection of offers that are perceived as too low, even if accepting would still result in a positive payoff. The degree of inequity aversion likely varies between individuals.
2.  **Expectations and Norms:** An individual's expectations about what constitutes a "fair" offer can influence their decision. These expectations may be shaped by prior experiences, social norms, or beliefs about the proposer's motivations.
3.  **Contribution:** An individual's contribution compared to the opponent will cause an emotional response to the fairness of the split.
4.  **Sensitivity to Money:** The individuals response to the split will be dependent on their sensitivity to the absolute or relative values of the money, such that some people will not care if they get £1 or £10, whereas others will care a lot.

**Interaction of Mechanisms:**

These mechanisms interact to determine the responder's overall utility for accepting or rejecting an offer. Inequity aversion reduces utility when the responder receives a smaller share. Expectations serve as a reference point against which the offer is evaluated. Contribution effects this "fairness", and monetary sensitivity makes it so that some decisions are weighted more than others.

**Mathematical Form:**

A utility function can capture these interactions. We'll use a model that incorporates:

*   A term for the proposed amount received.
*   A term for inequity aversion, weighted by a sensitivity parameter.
*   A term for contribution aversion, weighted by a sensitivity parameter.

**Parameters:**

*   `alpha`: Sensitivity to the amount of money offered.
*   `inequity_aversion`: Strength of aversion to receiving less than the proposer. Constrained to be greater or equal to zero.
*   `contribution_sensitivity`: Strength of sensitivity to a mismatch between relative contributions and relative splits. Should be able to be negative.

**Mapping to Observable Behavior:**

The model outputs a utility score. We'll say that if the utility score is greater than 0, the individual is more than 50% to accept. If the utility is less than 0, the individual is less than 50% to accept.

**Model Specification:**

```
<MODEL>
U = alpha * split_self - inequity_aversion * max(0, split_opp - split_self) + contribution_sensitivity * (token_self - token_opp) * (split_opp - split_self) / combined_earning
</MODEL>
